    },
    {
      name: '9',
      id: '009',
      image: '../images/mrjekyll.png',
      amount: 8,
      added: '2014-01-01'
    },
    {
      name: '10',
      id: '010',
      image: '../images/dayofthedead.png',
      amount: 11,
      added: '2014-01-01'
    },
  ]

const RatingBox = styled.div`
        margin-top: 50px;
		background-color: #eee;
        padding: 50px 50px;
        text-align: center;

        .button-circle {
            display: inline;
        }
`;

export default function Nav() {

	return (
        <RatingBox>
            <h3 className="font-weight-bold pb-4">
                How did we do?
            </h3>
            <p className="list-details__item grey-text">
                On a scale from 1 - 10, how easy did you find booking your hotel experience?
            </p>
            {feedback.map(rate => (
                <div className="button-circle" key={rate.id}>
                    <button className="">{rate.name}</button>
                </div>
            ))}
        </RatingBox>
  	);
}
